body {
    font-family: Arial, sans-serif;
    padding: 20px;
    line-height: 1.6;
}
h1 {
    margin-bottom: 20px;
}
.section {
    margin-bottom: 40px;
    padding: 20px;
    background: #f5f5f5;
    border-radius: 8px;
}
.section h2 {
    margin-top: 0;
    color: #333;
}

/* Two column layout */
.two-columns {
    column-count: 2;
    column-gap: 30px;
}

/* Three column layout */
.three-columns {
    column-count: 3;
    column-gap: 20px;
}

/* Column width based */
.auto-columns {
    column-width: 200px;
    column-gap: 25px;
}

/* With column rules */
.with-rules {
    column-count: 2;
    column-gap: 40px;
    column-rule-width: 2px;
    column-rule-style: solid;
    column-rule-color: #ccc;
}

/* Dotted rules */
.dotted-rules {
    column-count: 3;
    column-gap: 30px;
    column-rule-width: 1px;
    column-rule-style: dotted;
    column-rule-color: #999;
}

/* Column span test */
.with-spanning h3 {
    column-span: all;
    text-align: center;
    background: #ddd;
    padding: 10px;
    margin: 10px 0;
}

.with-spanning {
    column-count: 2;
    column-gap: 20px;
}
